import React, { Component } from 'react'
import './App.css'
export class App extends Component {

  constructor(){
    super();
    this.state={
      speed : 10
    }
  }

  componentDidMount(){
    this.setState({
      speed:25
    })
  }

  render() {
    return (
      <div className="App">
        <h1>{this.state.speed}</h1>
      </div>
    )
  }
}

export default App
